import React from "react";
import { Star } from "@material-ui/icons";
const RatingsFilterItems = props => {
  // const starRatingNum = [5, 4, 3, 2, 1];
  const { starRatingNum, onSelectedNum } = props;

  console.log(starRatingNum);
  console.log(onSelectedNum);
  return (
    <ul>
      {starRatingNum &&
        starRatingNum.map((ratingNum, i) => (
          <li
            key={i}
            className={
              starRatingNum === onSelectedNum
                ? "ratings__dropdonw-items ratings__dropdonw-items p-2 "
                : "ratings__dropdonw-items p-2"
            }
          >
            <div>
              <input
                type="checkbox"
                className="mr-2"
                onChange={e => props.onStarSelect(e)}
              />
              {ratingNum}{" "}
            </div>{" "}
            <span className="ml-2">
              {Array(ratingNum).fill(
                <Star fontSize={"small"} color={"secondary"} />
              )}
            </span>
          </li>
        ))}
    </ul>
  );
};

export default RatingsFilterItems;
